import logo from './logo.svg';
import './App.css';
import React from "react";
import {useNavigate} from 'react-router-dom';

const resultPage=()=>{
  navigate("./resultPage");
}

function App() {
  return (
    <div className="App">

      <div className="upperTitle">
        <p>MBTI</p>
        <button>관리자 페이지</button>
      </div>

      <div className="choseMbti">
        <div className="upperMbti">
           <button>E</button>
           <button>S</button>
           <button>T</button>
           <button>J</button>
        </div>

        <div className="explainMbti">
          <p>에너지 방향</p>
          <p>인식 방식</p>
          <p>판단</p>
          <p>생활 양식</p>
        </div>

         <div className="lowerMbti">
            <button>I</button>
            <button>N</button>
            <button>F</button>
            <button>P</button>
         </div>

         <div className="okBtn">
            <button onClick={resultPage}>확인</button>
         </div>
      </div>

      <div className="lowerTitle"></div>
    </div>
  );
}

export default App;
